  return (
    <>
    <Router>
      <Switch>
        <Route exact path="/">
          <Home/>
        </Route>
        <Route path ="/term/:slug">
          <Term />
        </Route>
        <Route path="/info">
          <Info/>
        </Route>
        <Route path="/form">
          <FormPage />
        </Route>
      </Switch>
    </Router>
    <Footer/>
    </>
  );
};

export default App;
